import PropTypes from "prop-types";

class App extends React.Component {
  constructor() {}

  state = {
    isLoading: true,
  };

  componentDidMount() {}

  componentDidUpdate() {}

  render() {
    return (
      <div>
        const {isLoading} = this.state;
        {isLoading ? "Loading" : "We are Ready"}
      </div>
    );
  }
}

export default App;
